function mpc = case8387pegase
%CASE8387PEGASE 8387-bus PEGASE case, by Florin Capitanescu
%   Please read carefully until the end before using these data sets. These
%   data stem from the Pan European Grid Advanced Simulation and State
%   Estimation (PEGASE) project, funded by the European Union
%   (http://www.fp7-pegase.com/). These data are derived from the original
%   data [A] provided to Florin Capitanescu in 2013 under request by the
%   data owners in PEGASE project. The derivation consists in: (i) removing
%   data related to a transmission system operator, which were replaced by
%   equivalent loads at the end of the three interconnection lines with the
%   rest of the system, (ii) some asymmetrical PI branch models were
%   approximated as symmetrical, averaging parameters values, (iii)
%   modelling differences concerning the transformer transversal
%   susceptance, (iv) data anonymization, (v) data conversion from Eurostag
%   (.ech) fromat to my OPF data format and then to MATPOWER (.m) format,
%   and (vi) definition of various AC OPF problems (see [B] below) readily
%   to obtain in MATPOWER format.
%
%   This power system model contains 8,387 buses, 1,865 generators, 4,669
%   loads, 12,474 lines, 2,087 transformers (out of which 589 OLTC and 84
%   phases shifters) and 178 shunt capacitors/reactors. Also, 1,299 lines
%   and 529 transformers (out of which 17 phase shifters) have more than one
%   circuit in parallel. The system models 8 voltage levels: 750, 400, 380,
%   330, 220, 150, 120, and 110 kV. These data represent reasonably well the
%   size and complexity of the European transmission system. However, these
%   data are fictitious and include modifications made on purpose to real
%   world data. They can thus be used to test methods and algorithms, but
%   any claim should not be made regarding the operation or planning of the
%   European power system.
%
%   These specific data sets were publicly released for the main purpose of
%   enabling testing methods and algorithms on truly numerically challenging
%   and tough optimization problems (see details in [B], where two solvers
%   in MATPOWER version 4.1 failed to converge on two instances and my own
%   OPF failed to converge on another instance) and more comprehensive in
%   terms of grid models and versatile AC OPF formulations. For example, [B]
%   presented results for 16 various instances of AC OPF problems with
%   different objective functions, sets of decision variables (e.g. among:
%   generators active/reactive powers, ratio of LTC transformers, reactance
%   of shunt capacitors/reactors, and angle of phase shifter transformers)
%   and constraints. If you wish to include control variables like
%   transformer ratio, phase shifter angle and shunt reactance, please
%   contact me to share with you their limits and discrete steps. In my AC
%   OPF instances all thermal limits were expressed only in terms of
%   current.
%
%   When publishing results based on these data, please cite:
%
%   [A] F. Villella, S. Leclerc, I. Erlich, S. Rapoport, "PEGASE
%       pan-European test-beds for testing of algorithms on very large scale
%       power systems". IEEE PES Innovative Smart Grid Technologies Europe
%       (ISGT Europe), Berlin (Germany), 2012.
%       doi: 10.1109/ISGTEurope.2012.6465783
%
%   [B] F. Capitanescu, L. Wehenkel, "Experiments with the interior-point
%       method for solving large scale optimal power flow problems",
%       Electric Power Systems Research, vol. 95, pp. 276-283, 2013.
%       doi: 10.1016/j.epsr.2012.10.001
%
%   Besides this test case, all AC OPF instances presented in [B] can be
%   easily obtained using one or some combinations of following features:
%
%   1)  The angle of all 84 phase shifters is set to zero.
%   2)  Identical unity costs (c=1.0) are used for all generators to
%       minimize the sum of generators active powers (an unconventional
%       loss minimization via also active power redispatch) as OPF
%       objective function.
%   3)  The quadratic OPF objective function minimizes the sum of squares
%       of generatorâ€™ active power deviation with respect to the initial
%       value Pgi^0 (provided in the data set), i.e. (Pgi-Pgi^0)^2. Thus,
%       the coefficients of the fictitious cost function are in p.u.
%       (100MVA base): (0.01*Pgi^0)^2, -2*0.01*Pgi^0, and 0.0001.
%   4)  The thermal limit of line between nodes 746 and 5968 and can be
%       decreased on purpose from 2061.62 MVA to 1000 MVA to create congestion
%       (around 20% current overload) and a tough OPF problem, see [B].
%
%   If you face convergence issues with your own NLP solver, some
%   simplifications are suggested:
%    -  Some generators (around 40) with small active power range (<=20MW)
%       are not taken as control variable, their active power remain at the
%       initial value;
%    -  Some generators (around 40) with small reactive power range
%       (<=10MVAr) are not taken as control variable, their reactive power
%       remain at the initial value;
%    -  The reactance of 98 short lines could be raised to the minimum
%       threshold value of 0.0002 pu;
%    -  Increase the convergence tolerance of the NLP solver to 10^-5 on
%       primal and relative dual feasibility.
%
%   Contact: Florin Capitanescu fcapitanescu@yahoo.com
%
%   February 18th, 2021

%   MATPOWER
%   Copyright (c) 2021 by Florin Capitanescu
%   Licensed under the Creative Commons Attribution 4.0 International license,
%   https://creativecommons.org/licenses/by/4.0/

